sys_variable_value.value:
(function execute(inputs, outputs) {
  var question = inputs.questions;
  var emails = [];
  while(question.next()) {
    var user = question.requested_by.getRefRecord();
    var email = user.getValue('email');
    if(email) {
      emails.push(email);
    }
  }
  outputs.emails = emails;
})(inputs, outputs);

